import React from "react";
import ReactDOM  from "react-dom";
import * as jh from './App'

function Cards(props)
{
  return(
    <>
 <div className="cards">
   <div className="card">
     <img src={props.imgsrc} alt="myPic" className="card_img"/>
     <div className="card_info">
       <span className="card_catagory">A Netflix Orignal Series</span>
       <h3 className="card_title"> </h3>
       <a href="https://www.netflix.com/in/title/80990668?source=35" target="_blank">
         <button>Watch Now</button>
       </a>
     </div>
   </div>
 </div>
  </>
  )
}
ReactDOM.render(
  <>
 <Cards imgsrc="https://wallpapercave.com/wp/wp4056410.jpg"/>
  </>,document.getElementById('root')
);
